import './App.scss';

const App= ({startQuiz}) => {

  return (
    <div className="card">
      <div className="card-content">
        <div className="content">
          <p>
          Did You Escape from NY or LA?
        </p>
          <button className="btn" onClick={startQuiz}>
            Start Quiz
          </button>  
        </div>
      </div>
    </div>
  );
}

export default App;
